import SearchForm from "@/components/SearchForm";
import StartupCard from "@/components/StartupCard";

export type StartupTypeCard = Omit<Startup, "author"> & { author?: Author };

export default async function Home({
  searchParams,
}: {
  searchParams: Promise<{ query?: string }>;
}) {
  const query = (await searchParams).query;
  const params = { search: query || null };
  

  const posts = [{
    _createdAt: new Date(),
    views: 55,
    author: { _id:1, name: 'Adrian'},
    _id: 1,
    description: "In a robot world, a young idealistic inventor travels to the big city to join his inspiration's company, only to find himself opposing its sinister new management.",
    image:'data:image/jpeg;base64,',
   category: 'Robots',
    title: 'We Robots',
  },]


  return (
    <>
      <section className="pink_container">
          <h1 className="heading">welcome to manila police district</h1>
          <p className="sub-heading !max-w-3xl"> 
            Submit Ideas, Vote on Pitches, and Get Noticed in Virtual Competitions
            </p>

            <SearchForm query={query} />
      </section>

      <section className="section_container">
        <p className="text-30-semibold">
          {query ? `Search results for "${query}"` : "All Startups"}
        </p>

        <ul className="mt-7 card_grid">
          {posts?.length > 0 ? (
            posts.map(( post:StartupTypeCard) => (
              <StartupCard key={post?._id} post={post} />
            ))
          ) : (
            <p className="no-results">No startups found</p>
          )}
        </ul>
      </section>
    
    </>
  );
}
